    /**
     * Outputs a font file.
     *
     * @param GalleryExecutionContext $ctx The execution context.
     */
    protected function outputFontFile($ctx) {
        $fontFile = null;
        if (!empty($_REQUEST['f'])) {
            $fontFile = (string)$_REQUEST['f'];
        }

        $fontFile = \trim(\strtolower($fontFile));
        if (!empty($fontFile)) {
            $font = $this->getFile($ctx, $fontFile);
        }

        if (!empty($font)) {
            $contentType = $this->getMimeTypeByFilename($fontFile);

            \header('Content-type: ' . $contentType);
            echo $font;
        }
        else {
            \header(':', true, 404);
        }
    }

