                    infoWinBody.find('.sg-right.sg-name').text(file.name);
                    infoWinBody.find('.sg-right.sg-size').text(file.size);
                    
                    var toTableValue;
                    toTableValue = function(v) {
                        var e;
                        if (typeof v === 'object') {
                            e = jQuery('<table class="table"><tbody></body></table>');
                            
                            var eBody = e.find('tbody');
                            
                            for (var k in v) {
                                var eRow = jQuery('<tr><td class="sg-left"></td><td class="sg-right"></td></tr>');
                            
                                eRow.find('.sg-left').text(k);
