                    if (file.exif) {
                        var infoWinExifTable = jQuery('<table class="sg-exif-table table table-striped"><tbody></body></table>');
                        
                        var infoWinExifTableBody = infoWinExifTable.find('tbody');
                        
                        for (var k in file.exif) {
