                    else {
                        infoWinExifTab.text('No EXIF data found.');
                    }
                    
                    // IPTC
                    var infoWinIptcTab = jQuery('#sg-image-info-modal-iptc-tab');
                    infoWinIptcTab.html('');
                    if (file.iptc) {
                        var infoWinIptcTable = jQuery('<table class="sg-iptc-table table table-striped"><tbody></body></table>');
                        
                        var infoWinIptcTableBody = infoWinIptcTable.find('tbody');
                        
                        for (var k in file.iptc) {
                            var infoWinIptcTableRow = jQuery('<tr><td class="sg-left"></td><td class="sg-right"></td></tr>');
                            
                            infoWinIptcTableRow.find('.sg-left').text(k);
                            infoWinIptcTableRow.find('.sg-right').append(toTableValue(file.iptc[k]));
                            
                            infoWinIptcTableRow.appendTo(infoWinIptcTableBody);
