            $SimpleGallery.funcs.initSearchButton = function() {
                var searchBtn = jQuery('#sg-navbar-top .sg-search-form .sg-search-btn');

                var searchField = jQuery('#sg-navbar-top .sg-search-form .sg-search-field');
                searchField.off('keyup').keyup(function() {
                    searchBtn.click();
                });
            };

            $SimpleGallery.funcs.initSearchField = function() {
                var searchField = $SimpleGallery.elements.searchField;

                var searchBtn = jQuery('#sg-navbar-top .sg-search-form .sg-search-btn');
                searchBtn.off('click').click(function() {
                    if ($SimpleGallery.funcs.searchImages) {
                        $SimpleGallery.funcs.searchImages(searchField.val());
                    }
                });
            };

            $SimpleGallery.funcs.initSearchForm = function() {
                if ($SimpleGallery.funcs.initSearchField) {
                    $SimpleGallery.funcs.initSearchField();
                }

                if ($SimpleGallery.funcs.initSearchButton) {
                    $SimpleGallery.funcs.initSearchButton();
                }
            };

            $SimpleGallery.funcs.reloadImages = function(path) {
                if (arguments.length < 1) {
                    path = $SimpleGallery.vars.curDir;
                }

                if ($SimpleGallery.vars.isLoadingImages) {
                    return;
                }
                
                var pageBody = jQuery('#sg-body .sg-folders-and-files-area');

                if ($SimpleGallery.funcs.ajax) {
                    $SimpleGallery.vars.isLoadingImages = true;

                    $SimpleGallery.funcs.ajax('get_image_files_and_folders', {
                        'beforeSend': function(ctx) {
                            pageBody.html('');
                            
                            var ajaxLoader = jQuery('<img class="sg-ajax-loader" />');
                            ajaxLoader.attr('src', $SimpleGallery.vars.ajaxLoader);
                            ajaxLoader.appendTo(pageBody);
                        },

                        'data': {
                            'dir': path
                        },

                        'success': function(ctx) {
                            pageBody.html('');

                            switch (ctx.data.code) {
                                case 0:
                                    if (ctx.data.data.dir) {
                                        $SimpleGallery.vars.curDir = ctx.data.data.dir;
                                    }
                                    
                                    $SimpleGallery.funcs.updateCurrentDirectoryView();

                                    if ($SimpleGallery.funcs.createFileAndFolderList) {
                                        var list = $SimpleGallery.funcs.createFileAndFolderList(ctx.data.data.folders, ctx.data.data.files);
                                        if (list) {
                                            list.find('.sg-file-item').hide();

                                            list.appendTo(pageBody);
                                        }

                                        $SimpleGallery.funcs.setupImageBox(list);
                                        $SimpleGallery.funcs.searchImages();
                                    }
                                    break;
                            }
                        },

                        'error': function(ctx) {

                        },

                        'complete': function(ctx) {
                            $SimpleGallery.funcs.searchImages();

                            $SimpleGallery.vars.isLoadingImages = false;
                        }
                    });
                }
            };

            $SimpleGallery.funcs.searchImages = function(expr) {
                if ($SimpleGallery.vars.isSearchingImages) {
                    return;
                }

                $SimpleGallery.vars.isSearchingImages = true;

                if (arguments.length < 1) {
                    expr = $SimpleGallery.elements.searchField.val();
                }

                $SimpleGallery.vars.lastSearchExpr = expr;

                expr = jQuery.trim(expr).toLowerCase();
                var exprParts = expr.split(" ");

                var fileAndFolderList = jQuery('.sg-folder-and-file-list');
                
                var fileList = fileAndFolderList.find('.sg-file-list');
                fileList.hide();
                
                var noItems = fileAndFolderList.find('.sg-no-items');
                noItems.hide();
                
                var visibleItems = 0;
                fileAndFolderList.find('.sg-file-item').each(function() {
                    var item = $(this);

                    var isVisible = true;
                    if ('' !== expr) {
                        var searchExprField = item.find('.sg-search-expr');
                        var objectField = item.find('.sg-object');
                        
                        var file;
                        try {
                            var fileJson = jQuery.trim(objectField.val());

                            file = JSON.parse(fileJson);
                            if (file) {
                                isVisible = file.isFav ? true : false;
                            }
                        }
                        catch (e) {
                            //TODO: log
                        }
                        
                        if (':favs' === expr) {
                            isVisible = false;                            
                            if (file) {
                                isVisible = file.isFav ? true : false;
                            }
                        }
                        else if (':nofavs' === expr || ':!favs' === expr) {
                            isVisible = false;                            
                            if (file) {
                                isVisible = file.isFav ? false : true;
                            }
                        }
                        else if (':gps' === expr) {
                            isVisible = false;                            
                            if (file) {
                                isVisible = file.gps ? true : false;
                            }
                        }
                        else {
                            var itemExpr = jQuery.trim(searchExprField.val()).toLowerCase();
                            for (var i = 0; i < exprParts.length; i++) {
                                var p = jQuery.trim(exprParts[i]);
                                if ('' !== p) {
                                    if (itemExpr.indexOf(p) < 0) {
                                        isVisible = false;
                                        break;
                                    }
                                }
                            }
                        }
                    }

                    var imgBox = item.find('.sg-imagebox');
                    if (isVisible) {
                        ++visibleItems;
                        
                        imgBox.attr('rel', 'sgGalleryVisible');
                        item.show();
                    }
                    else {
                        item.hide();
                        imgBox.attr('rel', 'sgGalleryHidden');
                    }
                });
                
                if (visibleItems > 0) {
                    fileList.show();
                }
                else {
                    noItems.show();
                }

                $SimpleGallery.vars.isSearchingImages = false;
            };

            $SimpleGallery.funcs.setupImageBox = function(list) {
                if (!list) {
                    return;
                }

                list.find('.sg-imagebox').fancybox({
                    'openEffect': 'none',
                    'closeEffect': 'none'
                });
            };
            
            $SimpleGallery.funcs.updateCurrentDirectoryView = function(dir) {
                if (arguments.length < 1) {
                    dir = $SimpleGallery.vars.curDir;
                }
                
                if (!dir) {
                    dir = '';
                }
                
                dir = jQuery.trim(dir);
                if ('' === dir) {
                    dir = '/';
                }
                
                var parts = dir.split("/").map(function(x) {
                    return jQuery.trim(x);
                }).filter(function(x) {
                    return '' !== x;
                }).map(function(x) {
                    var e = jQuery('<span></span>');
                    e.text(x);
                    
                    return {
                        'html': e.html(),                  
                        'value': x
                    };
                });
                
                parts.splice(0, 0, {
                    'html': '<i class="fa fa-home" aria-hidden="true"></i>'
                });
                
                var dirArea = $SimpleGallery.elements.body.find('.sg-current-directory');
                dirArea.html('');
                
                var createCrumbItemClickAction = function(path) {
                    return function() {
                        $SimpleGallery.funcs.reloadImages(path);
                    };
                };
                
                var crumb = jQuery('<ol class="breadcrumb"></ol>');
                var curDir = '/';
                for (var i = 0; i < parts.length; i++) {
                    var p = parts[i];
                    if (i > 0) {
                        curDir += p.value + '/';
                    }

                    var crumbItem = jQuery('<li><a href="#sg-folders-and-files-area-link"></a></li>');
                    crumbItem.html(p.html);
                    
                    var crumbLink = crumbItem.find('a');
                    if (i < (parts.length - 1)) {
                        crumbItem.click(createCrumbItemClickAction(curDir));
                        crumbItem.addClass('sg-non-current');
                    }
                    else {
                        crumbLink.addClass('active');
                        crumbItem.addClass('sg-current');
                    }
                    
                    crumbItem.appendTo(crumb);
                }
                
                crumb.appendTo(dirArea);
            };

            $SimpleGallery.vars = {};

            $SimpleGallery.vars.ajaxLoader = 'data:image/png;base64,' + <?= \json_encode(\base64_encode($this->getFile($ctx, 'ajax-loader.gif'))) ?>;
            $SimpleGallery.vars.curDir = <?= \json_encode($ctx->scopeDirectory) ?>;
            $SimpleGallery.vars.folderIcon = 'data:image/png;base64,' + <?= \json_encode(\base64_encode($this->getFile($ctx, 'folder.png'))) ?>;
            $SimpleGallery.vars.lastSearchExpr = '';
            $SimpleGallery.vars.isLoadingImages = false;
            $SimpleGallery.vars.isSearchingImages = false;
        </script>
    </head>

    <body>

<?php
