/**
 * Gallery file provider that uses an embedded ZIP file to access files.
 *
 * @author Marcel Joachim Kloubert <marcel.kloubert@gmx.net>
 *
 * @package MarcelJoachimKloubert\SimpleGallery
 */
class GalleryFileProvider {
    /**
     * @var \ZipArchive
     */
    protected $_zip;
    
    /**
     * Gets the content of a file.
     *
     * @param string $file The file.
     * @param mixed $ctx The execution context.
     *
     * @return string|null|false The content or (null) if not found.
     *                           (false) indicates that an error occurred.
     */
    public function getFile($file, $ctx) {
        $file = \trim($file);

        try {
            $zip = $this->getZip();
            if ($zip instanceof \ZipArchive) {
                for ($i = 0; $i < $zip->numFiles; $i++) {
                    $name = $zip->getNameIndex($i);
                    if ($name === $file) {
                        return $zip->getFromIndex($i);
                    }
                }
            }
            else if (false === $zip) {
                throw new GalleryException("Could not open embedded ZIP file!", 0);
            }
        }
        catch (\Exception $ex) {
            return false;
        }
        
        return null;
    }
    
    /**
     * Gets ZIP archive.
     * 
     * @return \ZipArchive The archive.
     */
    protected function getZip() {
        if (null === $this->_zip) {
            $this->_zip = false;
            
            $tempDir = \realpath(\sys_get_temp_dir());
            if (\is_dir($tempDir)) {
                $file = @\tempnam($tempDir, 'sg2_');
                try {
                    if (\is_file($file)) {
                        if (false !== \file_put_contents($file, \base64_decode($this->getZipBase64()))) {
                            $zip = new \ZipArchive();
                            if ($zip->open($file)) {
                                $this->_zip = $zip;
                            }
                        }
                    }
                }
                finally {
                   if (\is_file($file)) {
                       @\unlink($file);
                   }
                }
            }
        }
        
        return $this->_zip;
    }
    
    /**
     * Gets the Base64 content of the embedded ZIP file.
     * 
     * @return string The content.
     */
    protected function getZipBase64() {
        return '';
    }
}

$gallery = null;

$handleErrorOrException = function($arg) use (&$gallery) {
    $errorHandled = false;

    if (\is_object($gallery)) {
        $galleryClass = new \ReflectionObject($gallery);

        // $gallery->onError()
        if ($galleryClass->hasMethod(SG_METHOD_ONERROR)) {
            $errorHandled = false !== $galleryClass->getMethod(SG_METHOD_ONERROR)
                                                   ->invoke($gallery,
                                                            $arg);
        }
    }

    if (!$errorHandled) {
        \header(':', true, 500);
    }
};

// global error handler
\set_error_handler(function($code, $msg, $file, $line) use ($handleErrorOrException) {
    $handleErrorOrException([
        'code' => $code,
        'message' => $msg,
        'file' => $file,
        'line' => $line,
    ]);
});

\set_exception_handler(function($ex) use ($handleErrorOrException) {
    $handleErrorOrException([
        'exception' => $ex,
    ]);
});

\chdir(SG_DIR_CURRENT);

$configFile = \realpath(SG_DIR_CURRENT . 'sgConfig.php');
if (\is_file($configFile)) {
    $config = require $configFile;
}

if (empty($config)) {
    $config = [];
}

$isAuthorized = true;

if (!empty($config['users'])) {
    $isAuthorized = false;

    if (!empty($_SERVER['PHP_AUTH_USER'])) {
        $user = \trim(\strtolower($_SERVER['PHP_AUTH_USER']));

        $pwd = '';
        if (!empty($_SERVER['PHP_AUTH_PW'])) {
            $pwd = (string)$_SERVER['PHP_AUTH_PW'];
        }

        foreach ($config['users'] as $userEntry) {
            $userName = '';
            if (!empty($userEntry['name'])) {
                $userName = \trim(\strtolower($userEntry['name']));
            }

            if ($user === $userName) {
                $userPwd = '';
                if (!empty($userEntry['password'])) {
                    $userPwd = (string)$userEntry['password'];
                }

                if ($pwd === $userPwd) {
                    $isAuthorized = true;
                    break;
                }
            }
        }
    }
}

$realm = 'SimpleGallery (https://github.com/mkloubert/SimpleGallery)';
if (!empty($config['realm'])) {
    $realm = \trim($config['realm']);
}

if ($isAuthorized) {
    $directory = \realpath(@\getcwd());
    if (!\is_dir($directory)) {
        $directory = \realpath(SG_DIR_CURRENT);
    }

    if (!\is_dir($directory)) {
        exit(1);
    }
    
    if (empty($sessionName)) {
        $sessionName = 'SG2_SESSION';
    }
    
    @\session_name($sessionName);
    @\session_start();
    
    $action = '';
    if (!empty($_REQUEST['action'])) {
        $action = \trim(\strtolower($_REQUEST['action']));
    }

    $allowFolders = true;
    if (\array_key_exists('features', $config)) {
        if (\array_key_exists('allowFolders', $config['features'])) {
            if (null !== $config['features']['allowFolders']) {
                $allowFolders = !empty($config['features']['allowFolders']) ? true : false;
            }
        }
    }

    $directory .= \DIRECTORY_SEPARATOR;
    if ($allowFolders && !empty($_REQUEST['dir'])) {
        $scopeDir = \trim($_REQUEST['dir']);
        $scopeDir = \str_ireplace(\DIRECTORY_SEPARATOR, '/', $scopeDir);

        // remove unwanted strings
        do {
            $foundExpr = false;
            foreach (['./', '../', '/..', '/..'] as $expr) {
                if (false !== \stripos($scopeDir, $expr)) {
                    $foundExpr = true;
                    $scopeDir = \trim(\str_ireplace($expr, '', $scopeDir));
                }
            }
        }
        while ($foundExpr);

        $parts = [];
        foreach (\explode('/', $scopeDir) as $p) {
            $p = \trim($p);
            if (!empty($p)) {
                if ('.' === $p[0]) {
                    break;
                }

                $parts[] = $p;
            }
        }
        $scopeDir = \implode('/', $parts);

        $scopeDir = \trim($scopeDir, '/');
        if (!empty($scopeDir)) {
            if (\is_dir($directory . $scopeDir)) {
                $directory = \realpath($directory . $scopeDir) . \DIRECTORY_SEPARATOR;
                $scopeDirectory = '/' . $scopeDir;
            }
        }
    }

    if (empty($scopeDirectory)) {
        $scopeDirectory = '/';
    }

    if (!empty($config['files'])) {
        if (!empty($config['files']['include'])) {
            // custom include file
            $includeFileName = \trim($config['files']['include']);
        }
    }

    if (empty($includeFileName)) {
        $includeFileName = 'sgInclude.php';
    }

    // use include file?
    $includeFileUsed = false;
    $includeFile = SG_DIR_CURRENT . $includeFileName;
    if (\is_file($includeFile)) {
        require_once $includeFile;

        $includeFileUsed = true;
    }

    if (!empty($config['gallery'])) {
        // custom class?
        if (!empty($config['gallery']['class'])) {
            $galleryClassName = \trim($config['gallery']['class']);
        }
    }

    if (empty($galleryClassName)) {
        $galleryClassName = Gallery::class;  // default class
    }

    if (\class_exists($galleryClassName)) {
        $gallery = new $galleryClassName();
        $galleryClass = new \ReflectionObject($gallery);

        // $gallery->init()
        $initInvoked = false;
        if ($galleryClass->hasMethod(SG_METHOD_INIT)) {
            $initResult = $galleryClass->getMethod(SG_METHOD_INIT)
                                       ->invoke($gallery,
                                                $config);
            $initInvoked = true;

            if (false === $initResult) {
                throw new GalleryException('Could not initialize gallery!', 0);
            }
            else if (null !== $initResult) {
                exit((int)\trim($initResult));  // handle as exit code
            }
        }
        
        if (!empty($action)) {
            // check for a public method that starts with the
            // name of the action and has 'Action' as suffix
            
            $actionMethodName = $action . 'Action';
            if ($galleryClass->hasMethod($actionMethodName)) {
                $runMethodName = $actionMethodName;
            }
        }
        
        if (empty($runMethodName)) {
            $runMethodName = SG_METHOD_RUN;  // default
        }
        
        if ($galleryClass->hasMethod($runMethodName)) {
            $runMethod = $galleryClass->getMethod($runMethodName);
        }

        if (!empty($runMethod) && $runMethod->isPublic()) {
            if (!empty($config['context'])) {
                if (!empty($config['context']['class'])) {
                    $runCtxClassName = \trim($config['context']['class']);
                }
            }

            if (empty($runCtxClassName)) {
                $runCtxClassName = GalleryExecutionContext::class;  // default class
            }

            $runCtx = new $runCtxClassName();
            $runCtxClass = new \ReflectionObject($runCtx);

            // fill properties
            if ($runCtxClass->hasProperty('action')) {
                $runCtx->action = $action;
            }
            if ($runCtxClass->hasProperty('allowFolders')) {
                $runCtx->allowFolders = $allowFolders;
            }
            if ($runCtxClass->hasProperty('directory')) {
                $runCtx->directory = $directory;
            }
            if ($runCtxClass->hasProperty('scopeDirectory')) {
                $runCtx->scopeDirectory = $scopeDirectory;
            }

            $runArgs = [ $runCtx ];
            if (!$initInvoked) {
                $runArgs[] = $config;
            }

            $runResult = $runMethod->invokeArgs($gallery,
                                                $runArgs);

            if (false === $runResult) {
                throw new GalleryException('Could not run gallery!', 1);
            }
            else if (null !== $runResult) {
                exit((int)\trim($runResult));  // handle as exit code
            }
        }
        else {
            \header(':', true, 501);  // method not implemented
        }
    }
    else {
        if (!$includeFileUsed) {
            \header(':', true, 501);  // class not found
        }
    }
}
else {
    \header('WWW-Authenticate: Basic realm="' . $realm . '"');
    \header(':', true, 401);
}
